import React, { useState } from 'react';
import './styles/App.css';

function App() {
  const [formData, setFormData] = useState({
    gender: '',
    height: '',
    weight: '',
    goals: []
  });

  const [routine, setRoutine] = useState('');
  const [nutrition, setNutrition] = useState('');

  const handleInputChange = (e) => {
    const { name, value, type, checked } = e.target;
    if (type === 'checkbox') {
      setFormData(prev => {
        const newGoals = checked
          ? [...prev.goals, value]
          : prev.goals.filter(goal => goal !== value);
        return { ...prev, goals: newGoals };
      });
    } else {
      setFormData({ ...formData, [name]: value });
    }
  };

  const handleSubmit = async (e) => {
    e.preventDefault();
    try {
      const response = await fetch('http://localhost:5000/api/generate-plan', {
        method: 'POST',
        headers: { 'Content-Type': 'application/json' },
        body: JSON.stringify(formData)
      });

      const data = await response.json();
      if (data.success) {
        setRoutine(data.routine);
        setNutrition(data.nutrition);
      } else {
        alert('Error generating plan: ' + data.message);
      }
    } catch (err) {
      console.error('Fetch error:', err);
      alert('Network error. Is the backend running?');
    }
  };

  return (
    <div className="app-container">
      <header>
        <h1>FullStack Fitness</h1>
        <p>Your AI-Powered Personal Fitness & Nutrition Coach</p>
      </header>

      <main>
        <form onSubmit={handleSubmit}>
          <section className="input-section">
            <h2>Your Info</h2>
            <label>
              Gender:
              <select name="gender" value={formData.gender} onChange={handleInputChange} required>
                <option value="">Select</option>
                <option value="male">Male</option>
                <option value="female">Female</option>
                <option value="other">Other</option>
              </select>
            </label>

            <label>
              Height (cm):
              <input
                type="number"
                name="height"
                value={formData.height}
                onChange={handleInputChange}
                min="100"
                max="250"
                required
              />
            </label>

            <label>
              Weight (kg):
              <input
                type="number"
                name="weight"
                value={formData.weight}
                onChange={handleInputChange}
                min="30"
                max="300"
                required
              />
            </label>
          </section>

          <section className="goals-section">
            <h2>Fitness Goals</h2>
            <label>
              <input
                type="checkbox"
                name="goal"
                value="muscle gain"
                checked={formData.goals.includes('muscle gain')}
                onChange={handleInputChange}
              />
              Muscle Gain
            </label>
            <label>
              <input
                type="checkbox"
                name="goal"
                value="fat loss"
                checked={formData.goals.includes('fat loss')}
                onChange={handleInputChange}
              />
              Fat Loss
            </label>
            <label>
              <input
                type="checkbox"
                name="goal"
                value="improved endurance"
                checked={formData.goals.includes('improved endurance')}
                onChange={handleInputChange}
              />
              Improved Endurance
            </label>
          </section>

          <button type="submit">Generate My Plan</button>
        </form>

        {routine && (
          <section className="results-section">
            <h2>Weekly Workout Routine</h2>
            <pre className="routine">{routine}</pre>
          </section>
        )}

        {nutrition && (
          <section className="results-section">
            <h2>Daily Nutrition Guide</h2>
            <pre className="nutrition">{nutrition}</pre>
          </section>
        )}
      </main>

      <footer>
        <p>Powered by Gemini AI â€¢ Built for MHacks 2025</p>
      </footer>
    </div>
  );
}

export default App;
